promises/.body:
Promises Objects
The Promise object is used for deferred (to delay, to retard) and asynchronous computations. 
A Promise represents an operation that hasn't completed yet, but is expected in the future.
Creating a new Promise automatically sets it to the pending state.
Promises States
Internally, a promise can be in one of three states:

Pending, when the final value is not available yet
Fulfilled, when and if the final value becomes available. A fulfillment value becomes permanently associated with the promise. This may be any value, including undefined.
Rejected, if an error prevented the final value from being determined. This may be any value, including undefined, though it is generally an Error object, like in exception handling.

Creating Promises
The Promise Constructor function takes an anonymous function with 2 arguments known as handlers (resolve, reject)
let randomPromise = () => new Promise((resolve, reject) => (Math.random() > .5) ? resolve('ok') : reject('fail'));

Now using the created Promise
The second parameter on the then function acts as a catch block when things go wrong.
randomPromise().then(result => console.log(result), err => console.log(err));

then() and catch()
Promise.prototype.then and Promise.prototype.catch methods return promises, they can be chained
catch() block to treat exceptions and errors
Promise.resolve('oops, this is not a json to be parsed')
  .then(data => JSON.parse(data)) // Try to parse a non-JSON data send us to catch block
  .catch(error => alert(`Error: ${error.message}`)); // Error is alerted

Promise Chaining
The method then() returns a promise, so can be chained again on another then()
someFunction.somePromiseReturned()
  .then(getFiles)
  .then(generateIndex)
  .then(generatePosts);

Using Promises for Ajax Requests (Promisifying XMLHttpRequest)
function get(url) {
  return new Promise(function(resolve, reject) {
    // Do the usual XHR stuff
    let req = new XMLHttpRequest();
    req.open('GET', url);

    req.onload = function() {
      // This is called even on 404, so check the status
      if (req.status == 200) {
        // Resolve the promise with the response text
        resolve(req.response);
      }
      else {
        // Otherwise reject with the status text
        reject(Error(req.statusText));
      }
    };

    // Handle network errors
    req.onerror = function() {
      reject(Error("Network Error"));
    };

    // Make the request
    req.send();
  });
}

// Use the promisified XHR
get('story.json').then(function(response) {
  console.log("Success!", response);
}, function(error) {
  console.error("Failed!", error);
});

proxy/.body:
Proxy
Define different behaviours for methods inside an object.
The base syntax is let myProxy = new Proxy(target, handler);
target is an object (can be any object, including arrays, functions or even another proxy) or a function to wrap with Proxy.
handler is an object whose properties are functions which define the behavior of the proxy when an operation is performed on it.
traps Traps are used in Proxies to override native methods from an object. Trap is analogous to the concept of traps in operating systems.
List of Handler methods

handler.getPrototypeOf() A trap for Object.getPrototypeOf
handler.setPrototypeOf() A trap for Object.setPrototypeOf
handler.isExtensible() A trap for Object.isExtensible
handler.preventExtensions() A trap for Object.preventExtensions
handler.getOwnPropertyDescriptor() A trap for Object.getOwnPropertyDescriptor
handler.defineProperty() A trap for Object.defineProperty
handler.has() A trap for the in operator
handler.get() A trap for getting property values
handler.set() A trap for setting property values
handler.deleteProperty() A trap for the delete operator
handler.ownKeys() A trap for Object.getOwnPropertyNames
handler.apply() A trap for a function call
handler.construct() A trap for the new operator

Basic Example
In this example a random number between 1 and 10 gets returned as the default value when the object property does not exist 
It is using the get handler inside the object propety
let handler = {
    get(object, prop) {
        return prop in object ? object[prop] : Math.round(Math.random() * 10);
    }
};

let myProxy = new Proxy({}, handler);
myProxy.a = 1;
myProxy.b = undefined;

console.log(myProxy.a, myProxy.b); // 1, undefined
console.log(myProxy.anotherProperty); // Random number between 1 and 10

spread-operators/.body:
Spread Operators
The spread operator ... is a syntax to expand elements of an array in specific places, such as arguments in function calls.
Difference between Rest and Spread operator
Rest parameters is used in function definitions, and the spread operator is used in function invocations
In Arrays
Expand elements of an array within another array:
let values = [1, 2, 4],
    some = [...values, 8], // [1, 2, 4, 8]
    more = [...values, 8, ...values]; // [1, 2, 4, 8, 1, 2, 4]

// Old JS
let values = [1, 2, 4];
// Iterate, push, sweat, repeat...
// Iterate, push, sweat, repeat...

In Function calls
The spread syntax is also powerful when calling functions with arguments:
let values = [1, 2, 4];

doSomething(...values); // Same as doSomething(values[0], values[1], values[2])

The syntax is very flexible, because the spread operator can be used anywhere in the argument list. 
This means that the following invocation produces the same result:
let values = [2, 4];
doSomething(1, ...values);  // Same as doSomething(1, values[0], values[1])

In iterables
It can be applied to all iterable objects, such as a NodeList:
let form = document.querySelector('#my-form'),
    inputs = form.querySelectorAll('input'),
    selects = form.querySelectorAll('select');

let allElements = [form, ...inputs, ...selects];
// Now, allElements is a flat array containing the `` node and its `` and `` child nodes.

In Objects
Lets you use the spread ... operator to copy enumerable properties from one object to another or override them
let state = {someProp: '', visibilityFilter: false};
function mergeObjects(state) {
    return { ...state, visibilityFilter: true }
}

sets-and-weaksets/sets.html.body:
Sets
The Set Object stores unique values of any type, wheter primitives or object references
Problems with arrays
In arrays, duplicate entries are allowed, like below:
let tags = [];


tags.push("Javascript");
tags.push("Programming");
tags.push("Web");
tags.push("Web"); // Duplicate entry


console.log("Total items: ", tags.length); // 4

Sets prevent duplicate entries
We use the add() method to add elements to a Set
let tags = new Set();
tags.add("Javascript");
tags.add("Programming");
tags.add({version: "2015"}); // Primitive values and objects are allowed
tags.add("Web");
tags.add("Web"); // Duplicate entries are ignored

console.log('Total items: ', tags.size); // 4, the second "Web" was ignored

Set objects are iterable. We can use them with for...of and destructuring
let tags = new Set();
tags.add("Javascript");
tags.add("Programming");
tags.add({version: "2015"});
tags.add("Web");

for(let tag of tags) {
    console.log(tag);
}

// Destructure assignment allowed on Sets
let [a, b, c, d] = tags;
console.log(a, b, c, d);

sets-and-weaksets/weaksets.html.body:
Weaksets
More memory efficient type of Sets
The WeakSets is a type where only objects are allowed to be stored
WeakSets are not iterable, and you cannot read values
let weakTags = new WeakSet();

weakTags.add("Javascript"); // Invalid, Only objects can be added to Weaksets
weakTags.add({name: "Javascript"});
let iOS = {name: "iOS"};
weakTags.add(iOS);
weakTags.has(iOS); // true
weakTags.delete(iOS); // true

WeakSets use cases
We can use weakSets to create special groups from existing objects without mutating them. Favoring immutable objects allows for much simpler code with no unexpected side efffetcs.
Example of unecessary mutation on each post object without Weaksets
let readPosts = new WeakSet();
postList.addEventListener('click', (event) => {
    // Mutates 'post' objets, crating a new property to indicate if it has been read
    post.isRead = true; 
});
// ... rendering posts
for(let post of postArray) {
    if(!post.isRead) { // Checks a property on each post
        _addClassToPost(post.element);
    }
}

Example using WeakSets without the need to mutate objects (create flag properties)
Creating group of objects and check for the presence of those objects on the weakset group
let readPosts = new WeakSet();

postList.addEventListener('click', (event) => {
    readPosts.add(post); // Add objects to a group of read posts weakset
});

// ... rendering posts
for(let post of postArray) {
    if(!readPosts.has(post)) { // has() checks wether an object is present in the WeakSet
        _addClassToPost(post.element);
    }
}

strings/tagged-templates.html.body:
Tagged templates literal
Allows to modify the output of template literals using a function.
let a = 5,
    b = 10;

/*
The first argument contains an array of string 
literals ("Hello " , " world", and "" in this case below)
The second, and each argument after the first one, 
are the values of the processed 
(or sometimes called cooked) substitution expressions ("15" and "50" here).
*/
function someFunction(strings, ...values) {
  console.log(strings[0]); // "Hello "
  console.log(strings[1]); // " world "
  console.log(strings[2]); // ""
  console.log(values[0]);  // 15
  console.log(values[1]);  // 50

  return "Bazinga!";
}

someFunction`Hello ${ a + b } world ${ a * b }`;
//In the end, your function returns your manipulated string.
// "Bazinga!"

Tag functions don't need to return a string, as shown in the following example.
function template(strings, ...keys) {
  return (function(...values) {
    let dict = values[values.length - 1] || {},
        result = [strings[0]];
    keys.forEach(function(key, i) {
      let value = Number.isInteger(key) ? values[key] : dict[key];
      result.push(value, strings[i + 1]);
    });
    return result.join('');
  });
}

let t1Closure = template`${0}${1}${0}!`;
t1Closure('Y', 'A');  // "YAY!" 
let t2Closure = template`${0} ${'foo'}!`;
t2Closure('Hello', {foo: 'World'});  // "Hello World!"

Raw Strings
The special raw property, available on the first function argument of tagged template literals, allows you to access the raw strings as they were entered.
function tag(strings, ...values) {
  console.log(strings.raw[0]); 
  // "string text line 1 \n string text line 2"
}

tag`string text line 1 \n string text line 2`;

In addition, the String.raw() method exists to create raw strings just like the default template function and string concatenation would create.
String.raw`Hi\n${2+3}!`;
// "Hi\n5!"

strings/template-literals.html.body:
Template Literals
Template literals provide a clean way to create strings and perform string interpolation. 
You might already be familiar with the syntax; it‚Äôs based on the dollar sign and curly braces ${..}
Template literals are enclosed by backticks (${})
Here‚Äôs a quick demonstration:
let name = 'John',
   apples = 5,
   pears = 7,
   bananas = function() { return 3; };

console.log(`This is ${name}.`);
console.log(`He carries ${apples} apples, ${pears} pears, and ${bananas()} bananas.`);

// ES5 equivalent:
console.log('He carries ' + apples + ' apples, ' + pears + ' pears, and ' + bananas() +' bananas.');

In the form above, compared to ES5, they‚Äôre merely a convenience for string concatenation. However, template literals can also be used for multi-line strings. Keep in mind that white space is part of the string:
let x = `1...
2...
3 lines long!`; // Yay

// ES5 equivalents:
var x = "1...\n" + 
"2...\n" +
"3 lines long!";

var x = "1...\n2...\n3 lines long!";

symbols/.body:
Symbols
Symbols are a new primitive data type, like Number and String. You can use symbols to create unique identifiers for object properties or to create unique constants.
const MY_CONSTANT = Symbol();

let obj = {};
obj[MY_CONSTANT] = 1;

Note that key-value pairs set with symbols are not returned by Object.getOwnPropertyNames(), and they are not visible in for...in iterations, Object.keys() or JSON.stringify(). 
This is in contrast to regular string-based keys. 
You can get an array of symbols for an object with Object.getOwnPropertySymbols().
Symbols work naturally with const because of their immutable character:
const CHINESE = Symbol();
const ENGLISH = Symbol();
const SPANISH = Symbol();


switch(language) {
   case CHINESE:
      // 
      break;
   case ENGLISH:
      // 
      break;
   case SPANISH:
      // 
      break;
   default:
      // 
      break;
}

You can give a symbol a description. You can‚Äôt use it to access the symbol itself, but it‚Äôs useful for debugging.
const CONST_1 = Symbol('my symbol');
const CONST_2 = Symbol('my symbol');

typeof CONST_1 === 'symbol'; // true

CONST_1 === CONST_2; // false

async-await/.body:
Async Functions and await operator
Async function can contain await expression, that pauses the execution of the async function and waits for the passed promise's resolution, and resumes the async function's execution and returns the resolved value.
// Some function that returns a Promise
function getPromise() {
    return new Promise((resolve, reject) => Math.random() > .5 ? resolve('Lucky') : reject('Bad Luck'));
}

/*
async function
async/await let you write asynchronous code, using synchronous code structure
*/
async function main() {
    let result;
    // await receives a Promise, if rejected goes to catch block with respective error
    try {
        result = await getPromise();
    } catch (error) {
        result = `Error: ${error}`;
    }
    console.log(result);
}

// Run async function
main();
